const Timer = (props) => {
  return (
    <div className={props.hide ? '.d-none' : ''}>
      {props.time}
      <div>
        Too much pressure ?
        <button className="btn btn-dark">Hide Timer</button>
      </div>
    </div>
  )
}

export default Timer;
